    }

Password = () => {
    const pw = document.getElementById("myPW");
    if (pw.type === "password") {
        pw.type = "text";
    } else {
        pw.type = "password";
        }
    }

    render(){
        return(
            <div>
            <form>
                Name: <input type='text'></input> <br/>
                Email: <input type='text'></input> <br/>
                Password: <input type='password' value={this.state.PassWord} id='myPW'></input>

            </form> <br/>
            <button>Login</button>
            <button>Submit</button>
        </div>
        )
    }
}


export default Register
